    return (
        <div>
            <h2>Songs by User</h2>
            <ul>
                {songs.map(song => (
                    <li key={song.songId}>
                        <strong>Title:</strong> {song.title} | <strong>Release Date:</strong> {song.releaseDate}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ListSong;
